import{_ as A}from"./006-D-lAiJXD.js";import{_ as t}from"./008-C6TVXSfy.js";import{_ as o}from"./009-CELUo195.js";import{_ as r}from"./010-DDUYNioq.js";import{_ as g}from"./011-57kAEd1K.js";import{_ as n}from"./012-CQSyaFwC.js";import{_ as p}from"./013-QBaRAmgp.js";import{_ as i,c as a,a as e,o as c}from"./app-CUu1n7_5.js";const l="/parts-intellect-docs/assets/070-Ba-N9d2i.png",m="data:image/png;base64,",B="/parts-intellect-docs/assets/072-BWF55SeG.png",d="/parts-intellect-docs/assets/073-JUu8fHkR.png",v="data:image/png;base64,",C="data:image/png;base64,",h="/parts-intellect-docs/assets/076-D2yWXIaB.png",E="data:image/png;base64,",f="/parts-intellect-docs/assets/078-r_Qptp-S.png",P="/parts-intellect-docs/assets/079-BRcXsCyq.png",k="data:image/png;base64,",S="data:image/png;base64,",Y="/parts-intellect-docs/assets/082-BmPIuBSC.png",b="/parts-intellect-docs/assets/083-MDn15thj.png",j="data:image/png;base64,",I="data:image/png;base64,",u="data:image/png;base64,",D={};function U(J,s){return c(),a("div",null,s[0]||(s[0]=[e('<p>Импорт в <strong>Мастер создания Приходной накладной</strong> позволяет автоматически связать позиции из файла с ожидаемыми от поставщика позициями в программе (позиции в состоянии &quot;заказ поставщику&quot;). Если при импорте в мастер не найдется связанных позиций в заказах поставщикам, то такие товары будут пропущены. В <strong>Мастере создания Приходной накладной</strong> с помощью фильтров необходимо вначале отобрать позиции, среди которых требуется осуществлять подбор (например, фильтр по поставщику), затем подгрузить файл. Программа каждую позицию из файла сопоставляет с ожидаемыми позициями и подбирает найденные позиции в список выбранных. После создания и проводки такой <strong>Приходной накладной</strong> ее позиции связываются с ранее оформленными <strong>Заказом поставщика</strong> и <strong>Заказом клиента</strong>.</p><p>Для импорта позиций, ранее заказанных у поставщика, через мастера выполните следующие действия:</p><p><strong>»</strong> Предварительно подготовьте файл для импорта, содержащий список импортируемых позиций.</p><p><strong>»</strong> В <strong>Главном меню</strong> выберите раздел <strong>Склад и закупки ► Мастер создания ► Приходная накладная</strong>. Отобразятся элементы выбранного пункта.</p><p><img src="'+l+'" alt=""></p><p><img src="'+A+'" alt=""> <strong>Основной фильтр</strong></p><p>Позволяет отобрать позиции среди которых будет производиться отбор импортируемых позиций.</p><p>Блок содержит следующие фильтры:</p><ul><li><p><strong>Фильтр по дате</strong> – позволяет отобрать позиции за указанный в полях <strong>Начало</strong> и <strong>Окончание</strong> период;</p></li><li><p><strong>Дополнительный фильтр</strong>:</p><ul><li><p><strong>Название товара</strong> – позволяет указать необходимые наименование товара;</p></li><li><p><strong>Номера документов</strong> – позволяет указать номера документов <strong>Заказ поставщику</strong>, указывается через точку с запятой;</p></li></ul></li><li><p><strong>Контрагенты/Места хранения</strong>:</p><ul><li><p><strong>Поставщик</strong> – позволяет указать поставщика, от которого будет импортироваться накладная;</p></li><li><p><strong>Клиент</strong> – позволяет указать контрагента заказ которого связан с <strong>Заказом поставщику</strong>;</p></li><li><p><strong>Наша фирма</strong> – позволяет указать Нашу фирму, от которой оформлялся <strong>Заказ поставщику</strong>;</p></li><li><p><strong>Склад</strong> – позволяет указать склад назначения на который, по <strong>Заказу поставщику</strong>, необходимо было переместить товар после оприходования.</p></li></ul></li></ul><p><img src="'+t+'" alt=""> <strong>Обновить</strong></p><p><img src="'+m+'" alt=""></p><p>Позволяет обновить список позиций в блоке Доступные позиции.</p><p><strong>»</strong> В блоке фильтров укажите необходимые параметры фильтрации и нажмите кнопку <strong>Обновить</strong>. Программа отберет только те позиции, которые соответствуют заданным фильтрам.</p><p><strong>»</strong> Нажмите кнопку <strong>Импорт</strong> и выберите пункт <strong>Из файла</strong>. Появятся элементы для выбора файла с компьютера, который содержит импортируемые данные.</p><p><strong>»</strong> После выбора файла откроется окно разметки файла для импорта.</p><p><img src="'+B+'" alt=""></p><p><img src="'+A+'" alt=""> <strong>Исходный файл</strong></p><p><img src="'+d+'" alt=""></p><p>Отображает полный путь до импортируемого файла, при необходимости его можно заменить.</p><p><img src="'+t+'" alt=""> <strong>Таблица/лист из файла</strong></p><p><img src="'+v+'" alt=""></p><p>Позволяет выбрать в импортируемом файле необходимую для импорта таблицу или лист, в случае если их несколько.</p><p><img src="'+o+'" alt=""> <strong>Диапазон записей</strong></p><p><img src="'+C+'" alt=""></p><p>Позволяет указать количество верхних/нижних строк, данные из которых не будут импортированы. Данный параметр используется для того, чтобы предотвратить загрузку заголовка и названия колонок импортируемой таблицы.</p><p><img src="'+r+'" alt=""> <strong>Разметка колонок</strong></p><p>Позволяет установить соответствия колонок в файле с типом данных в программе в колонке <strong>Значение из файла/формула</strong>. Некоторые значения (валюта, страна и т.п.) можно установить из соответствующего справочника в программе в колонке <strong>Фиксированное значение из справочника</strong>.</p><div class="hint-container info"><p class="hint-container-title">Примечание</p><p>Поле <strong>Код*</strong> обязательное для разметки при импорте.</p></div><div class="hint-container info"><p class="hint-container-title">Примечание</p><p>При разметке файлов при импорте можно использовать предустановленные в программе специальные формулы для упрощения процесса импорта.</p></div><p><img src="'+g+'" alt=""> <strong>Список ранее сохраненных разметок</strong></p><p>Блок содержит ранее созданные и сохраненные разметки документов.</p><p><img src="'+n+'" alt=""> <strong>Настройки</strong></p><p><img src="'+h+'" alt=""></p><p>Содержит настройки:</p><ul><li><p><strong>Максимально допустимое превышение цены закупа -</strong> позволяет осуществить контроль фактической закупочной цены из файла относительно плановой закупочной ценой из <strong>Заказа поставщику</strong>. Если опция включена, то программа при отборе позиций будет сверять <strong>Закупочную цену (с НДС)</strong> из файла и <strong>Закупочную цену со скидкой и доставкой</strong> из связанного <strong>Заказа поставщику</strong>. Если цена закупа из файла возросла более чем на указанное количество процентов, то позиция не добавляется в список выбранных, а выводится в лог-файл с указанием причины.</p></li><li><p><strong>Максимально допустимое понижение цены закупа</strong> - позволяет осуществить контроль фактической закупочной цены из файла относительно плановой закупочной ценой из <strong>Заказа поставщику</strong>. , то программа при отборе позиций будет сверять <strong>Закупочную цену (с НДС)</strong> из файла и <strong>Закупочную цену со скидкой и доставкой</strong> из связанного <strong>Заказа поставщику</strong>. Если цена закупа из файла понизилась более чем на указанное количество процентов, то позиция не добавляется в список выбранных, а выводится в лог-файл с указанием причины.</p></li></ul><p><img src="'+p+'" alt=""> <strong>Далее</strong></p><p><img src="'+E+'" alt=""></p><p>Позволяет перейти к вкладке с информацией о текущей конфигурацией.</p><p><strong>»</strong> Поле <strong>Исходный файл</strong> содержит полный путь до импортируемого файла, при необходимости замените его. В нижней части окна выберите таблицу/лист из файла, который хранит импортируемые данные. В полях <strong>Диапазон записей</strong> укажите количество верхних/нижних строк, данные из которых не будут импортированы.</p><p><strong>»</strong> В верхней правой части окна на вкладке <strong>Разметка</strong> установите соответствия колонок в файле с типом данных в программе в колонке <strong>Значение из файла/формула</strong>. В случае если импорт из аналогичного файла уже осуществлялся и разметка была сохранена, рекомендуется выбрать данную разметку не создавая новую, в верхней левой части из <strong>Списка ранее сохраненных разметок</strong>.</p><p><strong>»</strong> На вкладке <strong>Настройки</strong> в окне разметки, при необходимости, осуществите контроль фактических закупочных цен из фала с плановыми закупочными ценами из заказов поставщику.</p><p><strong>»</strong> Для более быстрой и удобной обработки файлов импорта доступно использование ряда инструментов – <strong>Фильтрация данных и формулы</strong>.</p><div class="hint-container info"><p class="hint-container-title">Примечание</p><p>Для дальнейшего использования созданной разметки к аналогичным файлам ее необходимо сохранить.</p></div><p><strong>»</strong> После установки всех параметров разметки загрузки укажите наименование разметки в колонке <strong>Название разметки</strong> в блоке <strong>Список ранее сохраненных разметок</strong>.</p><p><strong>»</strong> Чтобы разметка была общедоступной в программе установите отметку в колонке <strong>Общая</strong> и нажмите кнопку <strong>Сохранить</strong>. Созданная конфигурация импорта будет сохранена и доступна для подстановки в поле <strong>Разметка для импорта</strong>. В случае если новая разметка не была сохранена, при переходе к следующему шагу отобразится диалоговое окно с информирующее о не сохраненной разметки.</p><p><img src="'+f+'" alt=""></p><p><img src="'+A+'" alt=""> <strong>Сохранить разметку</strong></p><p>Позволяет сохранить разметку колонок, для дальнейшего использования.</p><p><img src="'+t+'" alt=""> <strong>Продолжить без сохранения</strong></p><p>Позволяет продолжить работу мастера без сохранения разметки.</p><p><strong>»</strong> Для продолжения загрузки нажмите кнопку <strong>Далее</strong>. Откроется окно с параметрами загрузки.</p><p><img src="'+P+'" alt=""></p><p><img src="'+A+'" alt=""> <strong>Назад</strong></p><p><img src="'+k+'" alt=""></p><p>Позволяет перейти к предыдущему шагу импорта для изменения параметров.</p><p><img src="'+t+'" alt=""> <strong>Начать</strong></p><p><img src="'+S+'" alt=""></p><p>Позволяет запустить процесс импорта документа.</p><p><strong>»</strong> Для изменения параметров нажмите кнопку <strong>Назад</strong>. Для начала процесса импорта нажмите <strong>Начать</strong>!</p><p>В процессе импорта программа подберет соответствующие записи в мастере на основе данных из фала и добавит их в <strong>Список выбранных позиций мастера</strong>, а пропущенные позиции выведет в отельный лог-файл.</p><p><img src="'+Y+'" alt=""></p><p><img src="'+b+'" alt=""></p><p><img src="'+A+'" alt=""> <strong>Список выбранных позиций мастера</strong></p><p>Содержит список позиций добавленных в мастер из импортируемого файла.</p><p><img src="'+t+'" alt=""> <strong>Создать</strong></p><p><img src="'+j+'" alt=""></p><p><img src="'+I+'" alt=""></p><p>Позволяет создать следующие документы на основании позиций которые были импортированы из документа.</p><p><img src="'+o+'" alt=""> <strong>Действие с новыми документами</strong></p><p><img src="'+u+'" alt=""></p><p>Позволяет задать действие с документами которые будут созданы. По умолчанию выбрано значение <strong>Открыть в редакторе</strong>.</p><p><strong>»</strong> Для создания приходной накладной для выбранных позиций нажмите кнопку <strong>Создать</strong> и выберите пункт <strong>Приходные накладные.</strong></p><p>В данном примере мы импортировали позиции от одного поставщика, но мастер так же позволяет импортировать данные сразу от нескольких поставщиков, в этом случае программа сама отсортирует позиции и создаст <strong>Приходную накладную</strong> отдельно на каждого поставщика.</p><p><strong>»</strong> Откроется редактор приходной накладной на выбранные позиции от поставщика.</p>',74)]))}const K=i(D,[["render",U]]),Z=JSON.parse('{"path":"/work/postavshchiki/oformlenie_prikhoda/import_prikhoda/import_prikhoda_v_master_sozdaniya_prikhodnoj_nakladnoj.html","title":"Импорт прихода через Мастер создания приходной накладной","lang":"en-US","frontmatter":{"title":"Импорт прихода через Мастер создания приходной накладной","createTime":"2025/05/30 22:39:57"},"headers":[],"readingTime":{"minutes":3.52,"words":1056},"git":{"updatedTime":1748679750000,"contributors":[{"name":"a.lutoshkin","username":"","email":"a.lutoshkin@tradesoft.ru","commits":1,"avatar":"https://gravatar.com/avatar/605ee9d365e3a6380f8e9c71f9269ee5373d537aebefbece4e023cac396dfc8d?d=retro"}]},"filePathRelative":"work/postavshchiki/oformlenie_prikhoda/import_prikhoda/import_prikhoda_v_master_sozdaniya_prikhodnoj_nakladnoj.md","categoryList":[{"id":"67e92c","sort":10000,"name":"work"},{"id":"f92cdc","sort":10082,"name":"postavshchiki"},{"id":"1940b3","sort":10098,"name":"oformlenie_prikhoda"},{"id":"629cdb","sort":10129,"name":"import_prikhoda"}]}');export{K as comp,Z as data};
